  false,\n\t\"url\": null,\n\t\"notes\": \"The National Digital Forecast Database
  (NDFD) contains a seamless mosaic of the National Weather Service's (NWS) digital
  forecasts of precipitation amounts. In collaboration with NWS National Centers for
  Environmental Prediction (NCEP) and NWS Weather Forecast Offices (WFO), the central
  NDFD server ingests 5-km, 2-dimensional grids of precipitation amounts, and creates
  experimental forecast data mosaics for the coterminous United States (CONUS), Alaska,
  Hawaii, and Guam.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
